# –í–º–µ—Å—Ç–æ –º–Ω–æ–≥–æ—Ç–æ—á–∏—è —É–∫–∞–∂–∏—Ç–µ –Ω—É–∂–Ω—ã–µ –ø–∞—Ä–∞–º–µ—Ç—Ä—ã.
def find_pool_capacity(length, num_of_people, width=None):
    # –û–ø–∏—à–∏—Ç–µ —É—Å–ª–æ–≤–∏–µ, –∫–æ–≥–¥–∞ –ø–µ—Ä–µ–¥–∞–Ω–æ –æ—Ç—Ä–∏—Ü–∞—Ç–µ–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –¥–ª–∏–Ω—ã.
    if length < 0:
        length = -length
    # –û–ø–∏—à–∏—Ç–µ —É—Å–ª–æ–≤–∏–µ, –∫–æ–≥–¥–∞ –ø–µ—Ä–µ–¥–∞–Ω–æ –æ—Ç—Ä–∏—Ü–∞—Ç–µ–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ 
    # –∫–æ–ª–∏—á–µ—Å—Ç–≤–∞ –ª—é–¥–µ–π.
    if num_of_people < 0:
        num_of_people = -num_of_people

    # –û–ø–∏—à–∏—Ç–µ —É—Å–ª–æ–≤–∏–µ, –∫–æ–≥–¥–∞ —à–∏—Ä–∏–Ω–∞ –±–∞—Å—Å–µ–π–Ω–∞ –Ω–µ —É–∫–∞–∑–∞–Ω–∞, –∫–æ–≥–¥–∞ —É–∫–∞–∑–∞–Ω–æ
    # –æ—Ç—Ä–∏—Ü–∞—Ç–µ–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ, –∏ –∫–æ–≥–¥–∞ –ø–æ–ª–æ–∂–∏—Ç–µ–ª—å–Ω–æ–µ.
    if width is None:
        width = length
    elif width < 0:
        width = -width

    S = length * width

    # –û–ø–∏—à–∏—Ç–µ —É—Å–ª–æ–≤–∏–µ –≤—ã–≤–æ–¥–∞ —Å–æ–æ–±—â–µ–Ω–∏–π –∏ —Ä–∞—Å–ø–µ—á–∞—Ç–∞–π—Ç–µ —ç—Ç–∏ —Å–æ–æ–±—â–µ–Ω–∏—è.
    if S == 1 and num_of_people ==1:
        return print('–ë–∞—Å—Å–µ–π–Ω –ø–ª–æ—â–∞–¥—å—é ' + str(S) + ' –∫–≤. –º. –≤–º–µ—â–∞–µ—Ç ' + str(num_of_people) + ' —á–µ–ª.')

    if num_of_people == 0:
        return print('–ë–∞—Å—Å–µ–π–Ω –ø–ª–æ—â–∞–¥—å—é ' + str(S) + ' –∫–≤. –º. –≤–º–µ—â–∞–µ—Ç ' + str(num_of_people) + ' —á–µ–ª.')

    if S / num_of_people >= 2:
         return print('–ë–∞—Å—Å–µ–π–Ω –ø–ª–æ—â–∞–¥—å—é ' + str(S) + ' –∫–≤. –º. –≤–º–µ—â–∞–µ—Ç ' + str(num_of_people) + ' —á–µ–ª.')
    else:
         return print('–ë–∞—Å—Å–µ–π–Ω –ø–ª–æ—â–∞–¥—å—é ' + str(S) + ' –∫–≤. –º. –Ω–µ –≤–º–µ—â–∞–µ—Ç ' + str(num_of_people) + ' —á–µ–ª.')

# –ü—Ä–æ–≤–µ—Ä—å—Ç–µ —Ä–∞–±–æ—Ç—É —Ñ—É–Ω–∫—Ü–∏–∏, –º–æ–∂–µ—Ç–µ –ø–æ–¥—Å—Ç–∞–≤–∏—Ç—å —Å–≤–æ–∏ –∑–Ω–∞—á–µ–Ω–∏—è.
find_pool_capacity(4, 2)
find_pool_capacity(4, 5, 10)
find_pool_capacity(-10, -5, -2)
find_pool_capacity(1, 1, 1)

