#include <stdio.h>
#include <stdlib.h>
#include <string.h>

typedef struct Node {
    int data;
    struct Node* left;
    struct Node* right;
    int isThreaded;
} Node;


Node* createNode(int data);
Node* insert(Node* root, int data);
void printTree(Node* root, int level, int showThreads);
void inorder(Node* root);
void preorder(Node* root);
void postorder(Node* root);
void createThreadedBST(Node* root, Node** lastNode);
void threadedInorderTraversal(Node* root);
Node* leftMost(Node* node);
void deleteSubtree(Node** root, int key);
void freeTree(Node* root);
void clearInputBuffer();
int search(Node* root, int key);
void deleteSubtreeRecursive(Node** root, int key);
Node* copyTree(Node* root);

int main() {
    Node* root = NULL;
    Node* threadedRoot = NULL;
    int choice, data, key;
    Node* lastNode = NULL;

    while (1) {
        printf("1. –ü–æ—Å—Ç—Ä–æ–∏—Ç—å –¥–µ—Ä–µ–≤–æ –¥–≤–æ–∏—á–Ω–æ–≥–æ –ø–æ–∏—Å–∫–∞ –∏ –≤—ã–≤–µ—Å—Ç–∏\n");
        printf("2. –í—ã–ø–æ–ª–Ω–∏—Ç—å 3 –ø–æ–ª–Ω—ã—Ö –æ–±—Ö–æ–¥–∞ (—Å –≤—ã–¥–µ–ª–µ–Ω–∏–µ–º)\n");
        printf("3. –°–¥–µ–ª–∞—Ç—å —Å–∏–º–º–µ—Ç—Ä–∏—á–Ω—É—é –ø—Ä–∞–≤—É—é –ø—Ä–æ—à–∏–≤–∫—É –∏ –≤—ã–≤–µ—Å—Ç–∏\n");
        printf("4. –£–¥–∞–ª–µ–Ω–∏–µ –∏–∑ –ø—Ä–æ—à–∏—Ç–æ–≥–æ –¥–µ—Ä–µ–≤–∞ –∏ –≤—ã–≤–æ–¥\n");
        printf("5. –í—ã—Ö–æ–¥\n");
        printf("–í—ã–±–µ—Ä–∏—Ç–µ –ø—É–Ω–∫—Ç: ");

        if (scanf("%d", &choice) != 1) {
            printf("–û—à–∏–±–∫–∞ –≤–≤–æ–¥–∞!\n");
            clearInputBuffer();
            continue;
        }
        clearInputBuffer();

        switch (choice) {
            case 1:
                freeTree(root);
                freeTree(threadedRoot);
                root = NULL;
                threadedRoot = NULL;

                printf("–í–≤–µ–¥–∏—Ç–µ —ç–ª–µ–º–µ–Ω—Ç—ã (–¥–ª—è –∑–∞–≤–µ—Ä—à–µ–Ω–∏—è –≤–≤–µ–¥–∏—Ç–µ -1):\n");
                while (1) {
                    printf("–≠–ª–µ–º–µ–Ω—Ç: ");
                    if (scanf("%d", &data) != 1) {
                        printf("–ù–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–π –≤–≤–æ–¥. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.\n");
                        clearInputBuffer();
                        continue;
                    }
                    if (data == -1) break;
                    root = insert(root, data);
                }
                printf("\n–î–µ—Ä–µ–≤–æ:\n");
                printTree(root, 0, 0);
                break;

            case 2:
                if (root == NULL) {
                    printf("–î–µ—Ä–µ–≤–æ –ø—É—Å—Ç–æ!\n");
                    break;
                }
                printf("\n–ü—Ä—è–º–æ–π –æ–±—Ö–æ–¥ (—Ç—Ä–∞—Å—Å–∏—Ä–æ–≤–∫–∞): ");
                preorder(root);
                printf("\n–°–∏–º–º–µ—Ç—Ä–∏—á–Ω—ã–π –æ–±—Ö–æ–¥ (—Ç—Ä–∞—Å—Å–∏—Ä–æ–≤–∫–∞): ");
                inorder(root);
                printf("\n–û–±—Ä–∞—Ç–Ω—ã–π –æ–±—Ö–æ–¥ (—Ç—Ä–∞—Å—Å–∏—Ä–æ–≤–∫–∞): ");
                postorder(root);
                printf("\n");
                break;

            case 3:
                if (root == NULL) {
                    printf("–î–µ—Ä–µ–≤–æ –ø—É—Å—Ç–æ!\n");
                    break;
                }
                freeTree(threadedRoot);
                threadedRoot = copyTree(root);
                lastNode = NULL;
                createThreadedBST(threadedRoot, &lastNode);

                if (lastNode != NULL && lastNode->right == NULL) {
                    lastNode->right = threadedRoot;
                    lastNode->isThreaded = 1;
                }

                printf("\n–ü—Ä–æ—à–∏—Ç—ã–π —Å–∏–º–º–µ—Ç—Ä–∏—á–Ω—ã–π –æ–±—Ö–æ–¥: ");
                threadedInorderTraversal(threadedRoot);
                printf("\n\n–ü—Ä–æ—à–∏—Ç–æ–µ –¥–µ—Ä–µ–≤–æ:\n");
                printTree(threadedRoot, 0, 1);
                break;

            case 4:
                if (root == NULL) {
                    printf("–î–µ—Ä–µ–≤–æ –ø—É—Å—Ç–æ!\n");
                    break;
                }
                printf("–í–≤–µ–¥–∏—Ç–µ –∫–ª—é—á –¥–ª—è —É–¥–∞–ª–µ–Ω–∏—è: ");
                if (scanf("%d", &key) != 1) {
                    printf("–û—à–∏–±–∫–∞ –≤–≤–æ–¥–∞!\n");
                    clearInputBuffer();
                    break;
                }
                if (!search(root, key)) {
                    printf("–≠–ª–µ–º–µ–Ω—Ç %d –Ω–µ –Ω–∞–π–¥–µ–Ω.\n", key);
                }
                else {
                    deleteSubtree(&root, key);
                    deleteSubtree(&threadedRoot, key);

                    if (threadedRoot != NULL) {
                        lastNode = NULL;
                        createThreadedBST(threadedRoot, &lastNode);

                        if (lastNode != NULL && lastNode->right == NULL) {
                            lastNode->right = threadedRoot;
                            lastNode->isThreaded = 1;
                        }
                    }

                    printf("\n–ü–æ—Å–ª–µ —É–¥–∞–ª–µ–Ω–∏—è:\n");
                    printf("–ò—Å—Ö–æ–¥–Ω–æ–µ –¥–µ—Ä–µ–≤–æ:\n");
                    printTree(root, 0, 0);
                    printf("\n–ü—Ä–æ—à–∏—Ç–æ–µ –¥–µ—Ä–µ–≤–æ:\n");
                    printTree(threadedRoot, 0, 1);
                    printf("\n–û–±–Ω–æ–≤–ª—ë–Ω–Ω—ã–π –ø—Ä–æ—à–∏—Ç—ã–π –æ–±—Ö–æ–¥: ");
                    threadedInorderTraversal(threadedRoot);
                    printf("\n");
                }
                break;

            case 5:
                freeTree(root);
                freeTree(threadedRoot);
                printf("–ü—Ä–æ–≥—Ä–∞–º–º–∞ –∑–∞–≤–µ—Ä—à–µ–Ω–∞.\n");
                return 0;

            default:
                printf("–ù–µ–≤–µ—Ä–Ω—ã–π –≤—ã–±–æ—Ä! –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.\n");
        }
    }
    return 0;
}

Node* createNode(int data) {
    Node* newNode = (Node*)malloc(sizeof(Node));
    if (newNode == NULL) {
        printf("–û—à–∏–±–∫–∞ –≤—ã–¥–µ–ª–µ–Ω–∏—è –ø–∞–º—è—Ç–∏!\n");
        exit(1);
    }
    newNode->data = data;
    newNode->left = NULL;
    newNode->right = NULL;
    newNode->isThreaded = 0;
    return newNode;
}

Node* insert(Node* root, int data) {
    if (root == NULL) return createNode(data);
    if (data < root->data)
        root->left = insert(root->left, data);
    else if (data > root->data)
        root->right = insert(root->right, data);
    return root;
}

int search(Node* root, int key) {
    if (root == NULL) return 0;
    if (key == root->data) return 1;
    if (key < root->data) return search(root->left, key);
    if (!root->isThreaded) return search(root->right, key);
    return 0;
}

void printTree(Node* root, int level, int showThreads) {
    if (root == NULL) return;

    for (int i = 0; i < level; i++) {
        printf("    ");
    }
    printf("%d", root->data);

    if (showThreads && root->isThreaded && root->right != NULL) {
        printf(" (%d)", root->right->data);
    }
    printf("\n");

    int hasLeft = (root->left != NULL);
    int hasRight = (!root->isThreaded && root->right != NULL);

    if (hasLeft && hasRight) {
        printTree(root->left, level + 1, showThreads);
        printTree(root->right, level + 1, showThreads);
    }

    else if (hasLeft && !hasRight) {
        printTree(root->left, level + 1, showThreads);
        for (int i = 0; i < level + 1; i++) {
            printf("    ");
        }
        printf("-\n");
    }

    else if (!hasLeft && hasRight) {
        for (int i = 0; i < level + 1; i++) {
            printf("    ");
        }
        printf("-\n");
        printTree(root->right, level + 1, showThreads);
    }

}


void inorder(Node* root) {
    if (root == NULL) {
        printf("0 ");
        return;
    }
    printf("%d ", root->data);
    inorder(root->left);
    printf("(%d) ", root->data);
    inorder(root->right);
    printf("%d ", root->data);
}


void preorder(Node* root) {
    if (root == NULL) {
        printf("0 ");
        return;
    }
    printf("(%d) ", root->data);
    preorder(root->left);
    printf("%d ", root->data);
    preorder(root->right);
    printf("%d ", root->data);
}

void postorder(Node* root) {
    if (root == NULL) {
        printf("0 ");
        return;
    }
    printf("%d ", root->data);
    postorder(root->left);
    printf("%d ", root->data);
    postorder(root->right);
    printf("(%d) ", root->data);
}

Node* leftMost(Node* node) {
    if (node == NULL) return NULL;
    while (node->left != NULL)
        node = node->left;
    return node;
}


void createThreadedBST(Node* root, Node** lastNode) {
    if (root == NULL) return;

    createThreadedBST(root->left, lastNode);

    if (*lastNode != NULL && (*lastNode)->right == NULL) {
        (*lastNode)->right = root;
        (*lastNode)->isThreaded = 1;
    }
    *lastNode = root;

    if (!root->isThreaded) {
        createThreadedBST(root->right, lastNode);
    }
}

void threadedInorderTraversal(Node* root) {
    if (root == NULL) {
        printf("(–ø—É—Å—Ç–æ)");
        return;
    }

    Node* current = leftMost(root);
    int first = 1;
    int rootVisited = 0;

    while (current != NULL) {
        if (!first) {
            printf(" ");
        }
        printf("%d", current->data);
        first = 0;

        if (current == root) {
            if (rootVisited) {
                break;
            }
            rootVisited = 1;
        }

        if (current->isThreaded) {
            current = current->right;
        }
        else {
            current = leftMost(current->right);
        }
    }
}

Node* copyTree(Node* root) {
    if (root == NULL) return NULL;

    Node* newNode = createNode(root->data);
    newNode->left = copyTree(root->left);
    newNode->right = copyTree(root->right);
    newNode->isThreaded = 0;

    return newNode;
}


void deleteSubtree(Node** root, int key) {
    if (*root == NULL) return;


    if ((*root)->data == key) {
        freeTree(*root);
        *root = NULL;
        return;
    }

    deleteSubtreeRecursive(root, key);
}

void deleteSubtreeRecursive(Node** root, int key) {
    if (*root == NULL) return;

    if ((*root)->data == key) {
        Node* leftSubtree = (*root)->left;
        Node* rightSubtree = (*root)->right;

        free(*root);

        if (leftSubtree != NULL && rightSubtree != NULL) {
            Node* maxNode = leftSubtree;
            while (maxNode->right != NULL && !maxNode->isThreaded) {
                maxNode = maxNode->right;
            }
            *root = maxNode;
            maxNode->left = (maxNode != leftSubtree) ? leftSubtree : maxNode->left;
            maxNode->right = rightSubtree;
        }
        else if (leftSubtree != NULL) {
            *root = leftSubtree;
        }
        else {
            *root = rightSubtree;
        }
        return;
    }

    if (key < (*root)->data) {
        deleteSubtreeRecursive(&(*root)->left, key);
    } else {
        deleteSubtreeRecursive(&(*root)->right, key);
    }
}

void freeTree(Node* root) {
    if (root == NULL) return;
    freeTree(root->left);
    if (!root->isThreaded) {
        freeTree(root->right);
    }
    free(root);
}

void clearInputBuffer() {
    int c;
    while ((c = getchar()) != '\n' && c != EOF);
}

 public static string ImportSales(CarDealerContext context, string inputJson)
 {
     ICollection<Sale> salesToImport = new List<Sale>();
     IEnumerable<ImportSaleDto> saleDtos = JsonConvert.DeserializeObject<ImportSaleDto[]>(inputJson);

     if (saleDtos != null)
     {
         foreach (ImportSaleDto saleDto in saleDtos)
         {
             if (!IsValid(saleDto))
             {
                 continue;
             }

             bool isCarIdExisting = context
                     .Cars
                     .Any(c => c.Id == saleDto.CarId);

             if (!isCarIdExisting)
             {
                 continue;
             }

             bool isCustomerIdExisting = context
                 .Customers
                 .Any(cu => cu.Id == saleDto.CustomerId);

             if (!isCustomerIdExisting)
             {
                 continue;
             }

             Sale newsale = new Sale()
             {
                 CarId = saleDto.CarId,
                 CustomerId = saleDto.CustomerId,
                 Discount = saleDto.Discount
             };

             salesToImport.Add(newsale);
         }

         context.Sales.AddRange(salesToImport);
         context.SaveChanges();
     }

     return $"Successfully imported {salesToImport.Count}.";
 }

# Rate limiting based on source IP
# Allows ~5 login attempts per 60 seconds (adjust to your tolerance)
limit_req_zone $binary_remote_addr zone=dsm_login:10m rate=5r/m;

# If you want to be more strict: 3 attempts per minute
# limit_req_zone $binary_remote_addr zone=dsm_login:10m rate=3r/m;

server {
    listen 443 ssl http2;
    server_name nas.yourdomain.com;

    # Your SSL certificates
    ssl_certificate     /path/to/fullchain.pem;
    ssl_certificate_key /path/to/privkey.pem;

    # Synology DSM proxy settings
    location / {
        proxy_pass https://192.168.1.50;            # Your NAS local IP
        proxy_set_header Host $host;
        proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_set_header X-Forwarded-Proto $scheme;

        # Required for WebSocket (QuickConnect relay, notifications, etc.)
        proxy_http_version 1.1;
        proxy_set_header Upgrade $http_upgrade;
        proxy_set_header Connection "upgrade";

        # Increase buffer sizes for DSM
        proxy_buffering off;
        proxy_buffer_size 128k;
        proxy_buffers 4 256k;
        proxy_busy_buffers_size 256k;
    }

    # === BRUTE-FORCE PROTECTION FOR LOGIN ENDPOINTS ===
    location ~ ^/(webman/login\.cgi|auth\.cgi|webapi/auth\.cgi) {
        # Apply rate limiting only to login attempts
        limit_req zone=dsm_login burst=2 nodelay;

        # Optional: extra logging when someone hits the limit
        limit_req_log_level warn;

        # Optional: return 429 or custom page instead of default 503
        limit_req_status 429;

        proxy_pass https://192.168.1.50;
        proxy_set_header Host $host;
        proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_set_header X-Forwarded-Proto $scheme;
    }

    # Optional: custom 429 error page (Too Many Requests)
    error_page 429 /429.html;
    location = /429.html {
        root /usr/share/nginx/html;
        internal;
    }
}

int string_how_many(char c, char s[]) {
    char *sptr = s;
    int count = 0;

    while (*sptr != '\0') {
        if (*sptr == c) {
            count++;
        }
        sptr++;
    }

    return count;
}

void string_wipe_whitespaces(char s[]) {
    char *sptr = s; // inizializzo puntatore a s[0]
    char *reader = s;

    while (*reader != '\0') {
        if (*reader != ' ') {
            *sptr = *reader;
            sptr++;
            reader++;
        } else {
            reader++;
        }
    }
    *sptr = '\0';
}

from abc import ABC, abstractmethod

class Observer(ABC):
    """
    Interface untuk objek yang 'mengamati' (biasanya View).
    """
    @abstractmethod
    def update(self, subject, *args, **kwargs):
        pass

class Observable:
    """
    Kelas dasar untuk objek yang 'diamati' (biasanya Model).
    Memiliki daftar pengamat (observers) dan memberi tahu mereka jika ada perubahan.
    """
    def __init__(self):
        self._observers = []

    def add_observer(self, observer: Observer):
        if observer not in self._observers:
            self._observers.append(observer)

    def remove_observer(self, observer: Observer):
        if observer in self._observers:
            self._observers.remove(observer)

    def notify_observers(self, *args, **kwargs):
        """
        Memberi tahu semua observer bahwa ada perubahan data.
        """
        for observer in self._observers:
            observer.update(self, *args, **kwargs)

from model import ItemFactory

class ControllerPerpustakaan:
    """
    Controller dalam MVC + Observer.
    Tugasnya hanya memvalidasi input dan memanggil Model.
    Update View terjadi otomatis via Observer pattern.
    """
    def __init__(self, model, view):
        self.model = model
        self.view = view
        
        # Registrasi View sebagai Observer dari Model
        self.model.add_observer(self.view)
        
        # Trigger refresh awal
        self.model.refresh_data()

    def force_refresh(self):
        self.model.refresh_data()

    def add_member(self, nama, alamat):
        if not nama or not alamat:
            self.view.show_message("Error", "Data tidak lengkap", True)
            return
            
        from model import Member
        new_member = Member(nama, alamat)
        self.model.add_member(new_member) # Model akan notify View
        self.view.show_message("Sukses", f"Member {nama} berhasil ditambahkan")
        self.view.clear_forms()

    def add_item(self, tipe, item_id, judul, **kwargs):
        if not item_id or not judul:
            self.view.show_message("Error", "Data item tidak lengkap", True)
            return

        try:
            new_item = ItemFactory.create_item(tipe, item_id, judul, **kwargs)
            self.model.add_item(new_item) # Model akan notify View
            self.view.show_message("Sukses", "Item berhasil ditambahkan")
            self.view.clear_forms()
        except Exception as e:
            self.view.show_message("Error", str(e), True)

    def pinjam_item(self, member_id, item_id):
        if not member_id or not item_id:
            self.view.show_message("Error", "Pilih Member dan Item", True)
            return

        try:
            trx = self.model.create_transaction(member_id, item_id) # Model notify View
            self.view.show_message("Sukses", f"Transaksi {trx.transaksi_id} dibuat")
            self.view.clear_forms()
        except ValueError as e:
            self.view.show_message("Gagal", str(e), True)
        except Exception as e:
            self.view.show_message("Error", str(e), True)

    def kembalikan_item(self, trx_id):
        if not trx_id:
            self.view.show_message("Error", "Pilih Transaksi", True)
            return

        try:
            trx = self.model.return_transaction(trx_id) # Model notify View
            denda = trx.denda
            msg = "Pengembalian Sukses."
            if denda > 0:
                msg += f"\nTotal Denda: Rp{denda:,.2f}"
            
            self.view.show_message("Sukses", msg)
            self.view.clear_forms()
        except ValueError as e:
            self.view.show_message("Gagal", str(e), True)

    def save_and_exit(self):
        try:
            self.model.save_data()
            self.view.show_message("Info", "Data tersimpan. Keluar aplikasi.")
            self.view.root.destroy()
        except Exception as e:
            self.view.show_message("Error", f"Gagal menyimpan: {e}", True)

from abc import ABC, abstractmethod
from datetime import datetime, timedelta
from enum import Enum
import uuid
import pickle
import os
from observer import Observable

# ==============================================================================
# 1. FINITE STATE MACHINE (FSM) IMPLEMENTATION
# ==============================================================================

class TransactionContext:
    """
    Context untuk FSM Transaksi.
    Objek ini akan mengubah perilakunya berdasarkan state saat ini.
    """
    def __init__(self, member, item):
        self.transaksi_id = "TRX-" + str(uuid.uuid4())[:8].upper()
        self.member = member
        self.item = item
        self.tgl_pinjam = datetime.now()
        self.tgl_kembali_rencana = self.tgl_pinjam + timedelta(days=14)
        self.denda = 0.0
        self._state = ActiveState()

    def set_state(self, state):
        self._state = state

    def get_status_name(self):
        return self._state.get_name()

    def hitung_denda_saat_ini(self):
        return self._state.calculate_fine(self)

    def proses_pengembalian(self):
        self._state.return_item(self)

    def to_dict(self):
        return {
            "id": self.transaksi_id,
            "item": self.item.judul,
            "nama_member": self.member.nama,
            "tgl_pinjam": self.tgl_pinjam.strftime('%Y-%m-%d'),
            "tgl_kembali": self.tgl_kembali_rencana.strftime('%Y-%m-%d'),
            "status": self.get_status_name(),
            "denda": f"Rp{self.hitung_denda_saat_ini():,.2f}"
        }

class TransactionState(ABC):
    @abstractmethod
    def get_name(self): pass
    @abstractmethod
    def calculate_fine(self, context): pass
    @abstractmethod
    def return_item(self, context): pass

class ActiveState(TransactionState):
    def get_name(self): return "Aktif"
    def calculate_fine(self, context):
        if datetime.now() > context.tgl_kembali_rencana:
            print(f"INFO FSM: Transisi State {context.transaksi_id} [Active -> Overdue]")
            context.set_state(OverdueState())
            return context.hitung_denda_saat_ini()
        return 0.0
    def return_item(self, context):
        print(f"INFO FSM: Transisi State {context.transaksi_id} [Active -> Completed]")
        context.item.ubah_status(StatusItem.TERSEDIA)
        context.set_state(CompletedState())

class OverdueState(TransactionState):
    def get_name(self): return "Terlambat"
    def calculate_fine(self, context):
        selisih_hari = (datetime.now() - context.tgl_kembali_rencana).days
        return float(max(selisih_hari, 0) * 1000)
    def return_item(self, context):
        final_denda = self.calculate_fine(context)
        context.denda = final_denda
        print(f"INFO FSM: Transisi State {context.transaksi_id} [Overdue -> Completed] dengan denda {final_denda}")
        context.item.ubah_status(StatusItem.TERSEDIA)
        context.set_state(CompletedState())

class CompletedState(TransactionState):
    def get_name(self): return "Selesai"
    def calculate_fine(self, context): return context.denda
    def return_item(self, context): raise Exception("Item sudah dikembalikan sebelumnya.")

class StatusItem(Enum):
    TERSEDIA = "Tersedia"
    DIPINJAM = "Dipinjam"

class LoanableItem(ABC):
    def __init__(self, item_id, judul):
        self.item_id = item_id
        self.judul = judul
        self.status = StatusItem.TERSEDIA
    @abstractmethod
    def get_details(self): pass
    def ubah_status(self, status: StatusItem): self.status = status

class Buku(LoanableItem):
    def __init__(self, item_id, judul, pengarang):
        super().__init__(item_id, judul)
        self.pengarang = pengarang
    def get_details(self): return {"Tipe": "Buku", "Pengarang": self.pengarang}

class Majalah(LoanableItem):
    def __init__(self, item_id, judul, edisi):
        super().__init__(item_id, judul)
        self.edisi = edisi
    def get_details(self): return {"Tipe": "Majalah", "Edisi": self.edisi}

class ItemFactory:
    @staticmethod
    def create_item(tipe, item_id, judul, **kwargs):
        if tipe.lower() == 'buku': return Buku(item_id, judul, kwargs.get('pengarang', '-'))
        elif tipe.lower() == 'majalah': return Majalah(item_id, judul, kwargs.get('edisi', '-'))
        raise ValueError("Tipe item tidak dikenal")

class Member:
    def __init__(self, nama, alamat):
        self.member_id = "MEM-" + str(uuid.uuid4())[:8].upper()
        self.nama = nama
        self.alamat = alamat

# --- OBSERVER PATTERN ---

class Perpustakaan(Observable): # Warisi Observable
    def __init__(self, filepath="perpus_data.pkl"):
        super().__init__() # Init Observable
        self.filepath = filepath
        self.items = []
        self.members = []
        self.transactions = []
        self.load_data()

    def add_item(self, item):
        self.items.append(item)
        # Notify View: Item bertambah
        self.notify_observers(event="items_changed", data=self.items)

    def add_member(self, member):
        self.members.append(member)
        # Notify View: Member bertambah
        self.notify_observers(event="members_changed", data=self.members)

    def create_transaction(self, member_id, item_id):
        member = next((m for m in self.members if m.member_id == member_id), None)
        item = next((i for i in self.items if i.item_id == item_id), None)
        
        if not member or not item:
            raise ValueError("Member atau Item tidak ditemukan")
        if item.status != StatusItem.TERSEDIA:
            raise ValueError("Item sedang dipinjam")
            
        trx = TransactionContext(member, item)
        self.transactions.append(trx)
        item.ubah_status(StatusItem.DIPINJAM)
        
        # Notify View: Transaksi baru & status item berubah
        self.notify_observers(event="transactions_changed", data=self.transactions)
        self.notify_observers(event="items_changed", data=self.items) 
        return trx

    def return_transaction(self, trx_id):
        trx = next((t for t in self.transactions if t.transaksi_id == trx_id), None)
        if not trx:
            raise ValueError("Transaksi tidak ditemukan")
        
        trx.proses_pengembalian()
        
        # Notify View: Transaksi update & status item berubah
        self.notify_observers(event="transactions_changed", data=self.transactions)
        self.notify_observers(event="items_changed", data=self.items)
        return trx
    
    def refresh_data(self):
        """Method manual untuk memicu notifikasi semua data (misal saat startup)."""
        self.notify_observers(event="members_changed", data=self.members)
        self.notify_observers(event="items_changed", data=self.items)
        
        # Pastikan hitung denda terbaru sebelum notify
        for t in self.transactions:
            t.hitung_denda_saat_ini()
        self.notify_observers(event="transactions_changed", data=self.transactions)

    def save_data(self):
        data = {"items": self.items, "members": self.members, "transactions": self.transactions}
        with open(self.filepath, 'wb') as f: pickle.dump(data, f)

    def load_data(self):
        if os.path.exists(self.filepath):
            try:
                with open(self.filepath, 'rb') as f:
                    data = pickle.load(f)
                    self.items = data.get("items", [])
                    self.members = data.get("members", [])
                    self.transactions = data.get("transactions", [])
            except Exception as e: print(f"Error loading data: {e}")

